var loadingInstant = false;
var instantInterval = null;

function VeryBestFriends() {
	var GoogleLogo = document.getElementById("lga");
	var searchLogo = document.getElementById("gbqlw");
	if (loadingInstant) {
		if (document.getElementById("sfcnt") == null) {
			return;

		}
		clearInterval(instantInterval);
		loadingInstant = false;
	}

	if (GoogleLogo != null) {
		GoogleLogo.innerHTML = '<img id="hplogo" src="data:image/png;base64," style="width:551px;height:234px;margin-top:-7px;margin-left:1px" alt="" />';
	}

	if (searchLogo != null) {
		searchLogo.innerHTML = '<img id="gbqld" src="data:image/png;base64," width="114" height="48" alt="">';
    }
}

window.addEventListener("hashchange", VeryBestFriends, false);
if (window.location.hash != "") {
	loadingInstant = true;
	instantInterval = setInterval(VeryBestFriends, 100);
}

VeryBestFriends();